  }

  render() {
    const { Component, pageProps, router } = this.props;
    return (
      <SquaresProvider>
        <GridProvider>
          <PartsProvider>
            {/* <PageTransition
          timeout={400}
          loadingComponent={<SekndLoader></SekndLoader>}
